def get_index(name: str):
    """Get index data by name."""
    return INDICES.get(name)

def get_all_indices():
    """Get all available indices."""
    return list(INDICES.keys())

def get_companies(index_name: str):
    """Get companies for a specific index."""
    index_data = INDICES.get(index_name)
    return index_data.get("companies", []) if index_data else []
